 */
export const executePolygonWorkerOperation = async <T>(
  points: Point[],
  polygonWorker: PolygonWorker,
  operation: (points: Point[]) => Promise<T>,
  operationName: string,
  defaultValue: T
): Promise<T> => {
  try {
    if (!polygonWorker.isReady) {
