/**
 * Interface representing a bounding box
 */
export interface BoundingBox {
  minX: number;
  minY: number;
  maxX: number;
  maxY: number;
}

/**
 * Worker message types
 */
export interface WorkerRequest {
  id: string;
  operation: string;
  data: any;
}

export interface WorkerResponse {
  id: string;
